import './Review.css'
const Review = (props) => {
    return (
        <div className='Review'>
            <h2>{props.review.title}</h2>
            <h3>Author: {props.review.userId}</h3>
            <p>{props.review.body}</p>
        </div>
    )
}

export default Review;
